import React from 'react';
import '../../../css/App.css';
import { useEffect } from "react";
import Navbar from '../../../components/Navbar';
import Footer from '../../../components/Footer';
import GetModelImageData from '../../../utils/GetModelImageData';
import Button from 'react-bootstrap/Button';
import { useNavigate } from 'react-router-dom';

const ImageRanking= () => {
    var userData = undefined;
    var modelData = GetModelImageData();
    let navigate = useNavigate();

    useEffect(() => {
        if(window.sessionStorage.getItem('rankData') == null) {
            userData = ["C","A","B"]; //default for testing
            window.sessionStorage.setItem('rankData', JSON.stringify(userData));
        }
        else {
            userData = JSON.parse(window.sessionStorage.getItem('rankData'));
        }
        setSelectData();
        changeButtonState();       
      },[])

    function Next() {
        saveData();
        navigate('/survey/image-questionaire')       
    }

    function Previous() {
        saveData();
        navigate('/survey/image-marking')  
    }

    function setSelectData() {
        if(userData[0] != "") {
            document.getElementById("rank-one").value = userData[0];
        }
        if(userData[0] != "") {
            document.getElementById("rank-two").value =  userData[1];
        }
        if(userData[0] != "") {
            document.getElementById("rank-three").value =  userData[2];
        } 
    }

    function saveData() {
        userData[0] = document.getElementById("rank-one").value;
        userData[1] = document.getElementById("rank-two").value;
        userData[2] = document.getElementById("rank-three").value;
        window.sessionStorage.setItem('rankData', JSON.stringify(userData)); 
    }

    function changeButtonState() {
        if(
            document.getElementById("rank-one").value == "" || 
            document.getElementById("rank-two").value == "" ||
            document.getElementById("rank-three").value == ""
            ) 
            {
          
                document.getElementById("Next-button-part2").disabled = true;
            }      
            else 
            {
       
                document.getElementById("Next-button-part2").disabled = false;
            }  
    }
return (
    <div id="image-ranking">
        <div className="main-container">
            <div className="header">
                <Navbar/>
            </div>
            <div className="container">
                <div className="content" style={{textAlign: "center"}}>
                <div>
                <h1>Del 2</h1>
                <h4>Rangordna bilder</h4>
                <br>
                </br>
                <br>
                </br>
                </div>
                <div className="row">
                    <div style={{float: "left", width: "50%"}}>
                        <div id="A" className="ModelDiv">
                        <h2 style={{display: "inline"}}>A</h2>     
                        <img src={modelData[0][1]} style={{marginLeft: "10px"}}></img>
                        <img src={modelData[1][1]} style={{marginLeft: "10px"}}></img>
                        <img src={modelData[2][1]} style={{marginLeft: "10px"}}></img>        
                        </div>
                        <br>
                        </br>
                        <div id="B" className="ModelDiv">
                        <h2 style={{display: "inline"}}>B</h2>    
                        <img src={modelData[3][1]} style={{marginLeft: "10px"}}></img>
                        <img src={modelData[4][1]} style={{marginLeft: "10px"}}></img>
                        <img src={modelData[5][1]} style={{marginLeft: "10px"}}></img>                          
                        </div>
                        <br>
                        </br>
                        <div id="C" className="ModelDiv">
                        <h2 style={{display: "inline"}}>C</h2>    
                        <img src={modelData[6][1]} style={{marginLeft: "10px"}}></img>
                        <img src={modelData[7][1]} style={{marginLeft: "10px"}}></img>
                        <img src={modelData[8][1]} style={{marginLeft: "10px"}}></img>  
                        <br>
                        </br>
                        <br>
                        </br>            
                        </div>
                        <div>
                            <i>H√•ll muspekaren √∂ver en bild f√∂r att f√∂rstora den</i>
                        </div>
                    </div>
                    <div style={{float: "left", width: "50%"}}>
                        <p style={{textAlign: "left"}}>Rangordna de tre olika metoderna till v√§nster efter hur v√§l markeringarna representerar vad du anser √§r viktigt f√∂r att identifiera djuret p√• bilden.</p>
                        <div style={{textAlign: "left"}}>
                            <div style={{marginBottom: "30px", textAlign: "center"}}>
                                <h4 style={{display: "inline", marginRight: "20px"}}>1.</h4>
                                <select id="rank-one" style={{width: "150px"}} onChange={ () => { 
                                    if(document.getElementById("rank-two").value == document.getElementById("rank-one").value) {
                                        document.getElementById("rank-two").selectedIndex = 0;
                                    }
                                    if(document.getElementById("rank-three").value == document.getElementById("rank-one").value) {
                                        document.getElementById("rank-three").selectedIndex = 0;
                                    }
                                    changeButtonState();                            
                                }}> 
                                    <option value="" hidden>V√§lj en f√∂rklaring</option>
                                    <option value="A" style={{textAlign: "left"}}>A</option>
                                    <option value="B" style={{textAlign: "left"}}>B</option>
                                    <option value="C" style={{textAlign: "left"}}>C</option>     
                                </select>
                            </div>
                            <div style={{marginBottom: "30px", textAlign: "center"}}>
                            <h4 style={{display: "inline", marginRight: "20px"}}>2.</h4>
                                <select id="rank-two" style={{width: "150px"}} onChange={ () => { //Change to %?
                                    if(document.getElementById("rank-two").value == document.getElementById("rank-one").value) {
                                        document.getElementById("rank-one").selectedIndex = 0;
                                    }
                                    if(document.getElementById("rank-two").value == document.getElementById("rank-three").value) {
                                        document.getElementById("rank-three").selectedIndex = 0;
                                    }
                                    changeButtonState();
                            }}>
                                    <option value="" hidden>V√§lj en f√∂rklaring</option>
                                    <option value="A" style={{textAlign: "left"}}>A</option>
                                    <option value="B" style={{textAlign: "left"}}>B</option>
                                    <option value="C" style={{textAlign: "left"}}>C</option> 
                                </select>
                            </div>
                            <div style={{marginBottom: "30px", textAlign: "center"}}>
                            <h4 style={{display: "inline", marginRight: "20px"}}>3.</h4>
                            <select id="rank-three" style={{width: "150px"}} onChange={ () => { //Change to %?
                                    if(document.getElementById("rank-three").value == document.getElementById("rank-one").value) {
                                        document.getElementById("rank-one").selectedIndex = 0;
                                    }
                                    if(document.getElementById("rank-three").value == document.getElementById("rank-two").value) {
                                        document.getElementById("rank-two").selectedIndex = 0;
                                    }
                                    changeButtonState();
                            }}>
                                    <option value="" hidden>V√§lj en f√∂rklaring</option>
                                    <option value="A" style={{textAlign: "left"}}>A</option>
                                    <option value="B" style={{textAlign: "left"}}>B</option>
                                    <option value="C" style={{textAlign: "left"}}>C</option>  
                                </select>  
                            </div>
                        </div>
                    <div style={{textAlign: "center"}}>
                        <br>
                        </br>
                        <br>
                        </br>
                        <Button id="Previous-button-part2" style={{ marginBottom: "20px", marginRight: "20px", width: "90px"}} variant="outline-secondary" onClick={Previous}>Tillbaka</Button>
                        <Button id="Next-button-part2" style={{ marginBottom: "20px", marginLeft: "20px", width: "90px"}} variant="outline-secondary"onClick={Next}>N√§sta</Button>       
                    </div>
                </div>
            </div>  
                </div> 
                <Footer/>
            </div>
        </div>
    </div>
    )   
}



export default ImageRanking;
